INSERT INTO `v1_6d45dd9d761dfd8ac90b327e03149ced184366fda1eae00a75a7d2cf6a000092` VALUES ("B", "サレンディア救護院", 9, "泣き虫で臆病な守ってあげたい女の子", 12, "植田佳奈", 9, 40, 6, 102101, "観劇、おままごと", "クルミ", 150, 0, "ヒューマン", "あの、えっと…私、く、クルミですぅ…\nふ、ふぇぇぇ…ど、どうしようぅ…\nは、恥かしくて…ご、ごめんなさいぃぃ！");
