INSERT INTO `v1_6d45dd9d761dfd8ac90b327e03149ced184366fda1eae00a75a7d2cf6a000092` VALUES ("B", "サレンディア救護院", 9, "泣き虫で臆病な守ってあげたい女の子", 12, "植田佳奈", 9, 40, 6, 108501, "観劇、おままごと", "クルミ（クリスマス）", 150, 0, "ヒューマン", "あの、えっと…私、く、クルミですぅ…\nふ、ふぇぇぇ…ど、どうしようぅ…\nは、恥かしくて…ご、ごめんなさいぃぃ！");
INSERT INTO `v1_6d45dd9d761dfd8ac90b327e03149ced184366fda1eae00a75a7d2cf6a000092` VALUES ("B", "サレンディア救護院", 10, "ぷうきちといつも一緒！", 14, "芹澤優", 9, 38, 5, 108601, "屋内でできる遊び", "アヤネ（クリスマス）", 148, 0, "ヒューマン", "この子はね、ぷうきちって言うんだ\n武器なんだけど、しゃべるんだよ♪\n大事な大事な、私の友達なんだぁ～！");
INSERT INTO `v1_6d45dd9d761dfd8ac90b327e03149ced184366fda1eae00a75a7d2cf6a000092` VALUES ("A", "トゥインクルウィッシュ", 27, "人助けが大好き！　前向き格闘娘", 16, "東山奈央", 2, 44, 8, 108701, "人助け、応援", "ヒヨリ（ニューイヤー）", 155, 0, "獣人族", "こんにちは！　ヒヨリでっす！\n困っている人がいたら助けにいくよ！\nよかったら一緒に来ない？");
