INSERT INTO `v1_6d45dd9d761dfd8ac90b327e03149ced184366fda1eae00a75a7d2cf6a000092` VALUES ("B", "トゥインクルウィッシュ", 12, "クールで何事にも真っ直ぐな剣士", 18, "早見沙織", 2, 46, 1, 108901, "読書、乗馬、お茶", "レイ（ニューイヤー）", 163, 0, "魔族", "キミと会ったのもきっと何かの縁だ\n一緒に塔の頂上を目指す仲間として\n頑張っていこう。よろしく頼む");
INSERT INTO `v1_6d45dd9d761dfd8ac90b327e03149ced184366fda1eae00a75a7d2cf6a000092` VALUES ("B", "トワイライトキャラバン", 30, "運命の相手に一途すぎる乙女", 16, "橋本ちなみ", 13, 43, 7, 109001, "実験、裁縫、料理", "エリコ（バレンタイン）", 154, 0, "魔族", "『壊し屋』の二つ名を持つ私…\nですが、怖がる必要はありませんわ\nあなた様は大切な運命の人ですから…");
